import React from 'react';
import c from './MyPosts.module.css';

const MyPosts = () => {
    return <div>
        My posts
        <div>
            New post
        </div>
        <div className={c.posts}>
            <div className={c.item}>post 1</div>
            <div className={c.item}>post 2</div>
        </div>
    </div>
}

export default MyPosts;
